import React, { Component } from "react";

import Choropleth from 'react-leaflet-choropleth'
import { Map } from 'react-leaflet'
import crimes_by_district from './crimes_by_district.geojson'

const style = {
    fillColor: '#F28F3B',
    weight: 2,
    opacity: 1,
    color: 'white',
    dashArray: '3',
    fillOpacity: 0.5
}

const map = (geojson) => (
  <Map>
    <Choropleth
      data={{type: 'FeatureCollection', features: geojson}}
      valueProperty={(feature) => feature.properties.value}
      visible='true'
      scale={['#b3cde0', '#011f4b']}
      steps={7}
      mode='e'
      style={style}
      onEachFeature={(feature, layer) => layer.bindPopup(feature.properties.label)}
      ref={(el) => this.choropleth = el.leafletElement}
    />
  </Map>
)

class App extends Component {
  render() {
    return (
      map(crimes_by_district)
    );
  }
}

export default App;
